import React from "react";

function ErrorMessage(props) {
  const closeError = () => props.closeError(false);
  return (
    <div onClick={closeError}>
      <p>Error message</p>
      <button onClick={closeError}>Okay</button>
    </div>
  );
}

export default ErrorMessage;
